import React from 'react';
import styled from "styled-components/native";
import { Place } from "../../Place"
import { Button, Title } from "react-native-paper";
import { FlatList } from "react-native-gesture-handler"

export const Layout = ({ navigation, tripsPlaces }) => (
    <Container>
        <Title> My places </Title>
        <Button 
            mode="contained" 
            style={{backgroundColor: "rgb(25, 118, 210)", marginVertical: 10}} 
            onPress={() => console.log("Me apretaron") /*navigation.push("AddReview", {placeId:placeId})*/}
        >
            Add Place
        </Button>
        <FlatList
            data={tripsPlaces}
            renderItem={ ({ item }) =>
                <Place placeId={item.place.id} name={item.place.name} mainImageUrl={item.place.mainImageUrl} navigation={navigation} />
            }
            keyExtractor={item => item.id}
        />
    </Container>
)

const Container = styled.ScrollView`
  flex: 1;
  padding: 10px 20px;
`;
